(4, 1, 6, 'حلويات سورية', 'sirian sweets', '<p>تتميّزالحلويات السورية بلذتها ومذاقها الطيب، وتشتهر سوريا بصنع ما لذّ وطاب من الحلويات ذات المصدر الغذائي الغنيّ بالسعرات الحراريّة، كما أنّه يمد جسم الإنسان بالطاقة التي تعطيه القدرة على العمل لساعات طويلة، ويكثر صنع الحلويات في البلاد العربيّة المجاورة وخاصةً في شهر رمضان المبارك. وكلّ مدينة في سوريا لها مجموعة من الحلويات تميّزها عن غيرها من المدن، ومن أكثر أطباق الحلويّات التي يتميّز بها المطبخ السوريّ هي البقلاوة، والبرازق، والمشكّل، وأصابع الستّ، والمحلايّة، وغيرها من أطباق الحلويّات المتنوّعة ما بين الحلويّات التقليديّة والحلويّات العصريّة،&nbsp;</p>', '<pre data-fulltext=\"\" data-placeholder=\"Translation\" dir=\"ltr\" id=\"tw-target-text\">\r\nSyrian sweets are characterized by their taste and good taste. Syria is famous for making sweets with a high calorie food source. It also provides the human body with the energy that gives it the ability to work long hours. Confectionery is often made in the neighboring Arab countries, especially in the holy month of Ramadan. And every city in Syria has a range of sweets distinguish them from other cities, and one of the most delicious dishes that characterize the Syrian cuisine is Baklava, Barzak, and the problem, and the fingers of six, and Mahlaya, and other dishes of sweets between traditional sweets and sweets,</pre>', 1, NULL, '2019-05-14 10:37:51', '2019-05-14 10:37:51'),
(5, 1, 6, 'حلويات تركية', 'Turkish cuisine', '<p>ركيا من الدول التى تهتم كثيراً بالغذاء و لقد تميز المطبخ التركيى بمجموعة&nbsp;<strong><em>حلويات تركية</em></strong>&nbsp;ذات&nbsp;سمعة مميزة على مستوى العالم حيث يوجد فى تركيا عدد كبير من الحلويات ذات الطعم الجميل بشكل لا يصدق&nbsp;</p>', '<pre data-fulltext=\"\" data-placeholder=\"Translation\" dir=\"ltr\" id=\"tw-target-text\">\r\nTurkish cuisine is distinguished by a group of Turkish sweets with a distinguished reputation in the world where Turkey has a large number of sweets with an incredibly beautiful taste</pre>', 1, NULL, '2019-05-14 11:19:44', '2019-05-14 11:19:44'),
