(12, 'سباك', 'Plumber', 'فايل رول يوفر برنامج حسابات متكامل ويدعم اللغة العربية لإدارة محلات السباكة، باستخدام فايل رول يمكنك أن تقوم بإنشاء نماذج فواتير لعمليات البيع أو الصيانة وقطع الغيار، ويمكنك إدارة مخزونك من المنتجات ومتابعة عملاءك فيما بعد عمليات البيع وتنظيم مواعيد الصيانة مع العمال و العملاء، كما أنه يساعدك على التسويق لمنتجاتك وخدماتك الجديدة عن طريق إرسال التنبيهات لعملائك آلياً.', 'Fileroll provides an integrated accounting program that supports Arabic language for plumbing management. Using Fileroll you can create billing forms for sales, maintenance, and spare parts. You can manage your stock of products, follow up your customers after sales and organize maintenance schedules with workers and customers. Helps you to market your new products and services by automatically sending alerts to your customers.', 110, 1, 112, 'rgb(51, 125, 191)', 'rgb(56, 118, 29)', 'Hotels', 1, '2019-07-22 12:36:58', '2019-10-14 13:35:08'),
(11, 'كهربائى', 'Electricity Shop', 'ستجد لدينا العديد من اللمبات ووحدات الاضاءة الصغيرة كما ستجد العديد من الاسلاك والوصلات الناقلة للتيار الكهربي بالاضافة الى ذلك ستجد العديد من الوحدات او النقاط (البريزة) كما ستجد الكثير من الاكباس وبالاضافة الى ذلك ستجد اكثر من مشترك وان بحثت اكثر فستجد العديد من مستلزمات وادوات الكهرباء الاخري، وان قررت الذهاب في يوم من الايام لزيارة احد الاصدقاء في منزلة او زيارة احد المحلات التجارية لشراء بعض الاغراض او اذا قررت الذهاب الى مركز تدريب او عيادة طبية او مكتب محاماة او اي مكان اخر فستجد ان هناك مستلزمات وادوات كهربائية مماثلة للتي تمتلكها في منزلك، وهذا يعنى ان تلك المنتجات تصنف ضمن المنتجات الاساسية التى يحتاج اليها اى مكان ليصبح مؤهل للعيش به او لاستقبال الناس بة ويعنى ايضاً ان هناك طلب كبير جداً عليها', 'Look at the house or apartment where you live and you will find that there are many bulbs and small lighting units and you will find many wires and connections to the electrical current in addition to you will find many units or points (Albreza) and you will find a lot of compass and in addition you will find more than one subscriber If you look for more, you will find many other electrical appliances and accessories,', 129, 1, 137, 'rgb(106, 201, 65)', 'hsv(0, 0%, 29%)', 'Basic', 1, '2019-07-22 12:36:58', '2019-09-04 14:55:02'),
(9, 'مشغلى', 'Sewing', '<p>&nbsp;نقدم الوظائف الاتيه</p>\r\n\r\n<p align=\"right\"><span dir=\"RTL\">تحديد انواع المقاسات المستخدمة</span></p>\r\n\r\n<p align=\"right\"><span dir=\"RTL\">تحديد شروط الغاء طلب الحياكة</span></p>\r\n\r\n<p align=\"right\"><span dir=\"RTL\">تسجيل مقاسات عميلة مع الاحتفاظ بالسجل التاريخى للقياس</span></p>\r\n\r\n<p align=\"right\"><span dir=\"RTL\">امكانية الترزى لاستعراض مقاسات عميلة</span></p>\r\n\r\n<p align=\"right\"><span dir=\"RTL\">امكانية الترزى تسجيل طلب حياكة مع اختيار القماش من المحل &nbsp;وتحديد موعد البروفة و التسليم</span></p>', '<pre data-placeholder=\"Translation\" dir=\"ltr\" id=\"tw-target-text\">\r\nSpecify the types of measurements used\r\nSpecify the conditions for canceling the knitting request\r\nRecord customer sizes while maintaining the historical record of measurement\r\nAbility to compare the size of a client\r\nPossibility of registration Registration of fabric request with the selection of cloth from the shop and determine the date of rehearsal and delivery</pre>', 132, 1, 138, 'hsv(0, 79%, 93%)', 'rgb(85, 201, 34)', 'Basic', 1, '2019-06-20 09:27:56', '2019-09-04 14:55:31'),
(13, 'فندق', 'Hotel', 'من خلال هذا النشاط تستطيع تسجيل بيانات الوحدات واسعارها وبيانات الخدمات المتاحة لكل وحدة و ايضا ادارة بيانات عملاءك و ادارة المستودع وووو', 'Through this activity you can record units data and prices and data services available for each unit and also manage your customers data and warehouse management', 115, 1, 116, 'hsv(0, 0%, 0%)', 'hsv(0, 0%, 0%)', 'Hotels', 1, '2019-08-29 08:40:49', '2019-10-09 14:37:00'),
(14, 'صالون تجميل', 'Beauty Center', 'حين يتعلق الأمر بتدليل النفس، فالحظ حليفنا ، إذ لدينا مهارات  متعدّدة الثقافات أبرز مصفّفي الشعر في العالم لإبراز أعمالهم وفتح مؤسسات لهم فيها، في حين يسرّ خبراء التجميل المحليّون مشاركة فنّ التجميل العربي الأصيل، حيث تكون خدمات تصفيف الشعر وتزيين الأظافر وعلاج البشرة جزءًا من نظام الصالونات الأسبوعي.', 'When it comes to self pampering, our luck is lucky. We have the multicultural skills of the world\'s leading hairdressers to showcase their work and open institutions for them, while local beauty experts are delighted to share authentic Arab cosmetics, where hairdressing, nail decoration and skin treatment services are part of the Weekly Salons.', 133, 1, 139, 'hsv(0, 0%, 0%)', 'hsv(0, 0%, 0%)', 'Basic', 1, '2019-09-01 14:27:23', '2019-09-04 14:56:02'),
(15, 'اخرى', 'other', NULL, NULL, 135, 1, 140, 'hsv(0, 28%, 11%)', 'hsv(0, 23%, 13%)', 'Basic', 1, '2019-09-03 07:59:26', '2019-09-04 14:59:31');
