INSERT INTO `advantages` (`id`, `name`, `name_en`, `description`, `description_en`, `image`, `active`, `layout`, `background`, `emotion`, `sys_user_id`, `created_at`, `updated_at`) VALUES
(1, 'سهولة الاستخدام', 'EASY TO USE', '<p>مع فايل رول انشاء الفواتير اسهل واسرع. أضف جميع المنتجات أو الخدمات التي تقدمها في النظام مع وصفها وسعرها والضرائب. عندما تقوم بإنشاء فاتورة جديدة يمكنك أن تختار أي من هذه المنتجات المحفوظة مسبقاً حتى تصبح عملية انشاء الفواتير أسهل وأسرع</p>', '<pre data-fulltext=\"\" data-placeholder=\"الترجمة\" dir=\"ltr\" id=\"tw-target-text\">\r\n<big>With FileRail create invoices easier and faster. Add all products or services you offer in the system with their description, price and taxes. When you create a new invoice, you can choose any of these pre-saved products to make it easier and faster to create invoices</big></pre>', 87, 1, 'radius', 'hsv(297, 37%, 89%)', 'blink', 1, '2019-05-07 11:34:19', '2019-07-14 14:04:28'),
(2, 'الامان', 'secured', '<h3>بيانات شركتك في أمان</h3>\r\n\r\n<h3>مع فايل رول تعمل في بيئة أمنة و شبكة خاصة مؤمنة بالكامل. فايل رول محمى من كل الاختراقات على أعلى مستوى.&nbsp;</h3>', '<pre data-fulltext=\"\" data-placeholder=\"الترجمة\" dir=\"ltr\" id=\"tw-target-text\">\r\nYour company data is secure\r\nWith FileRoll works in a secure environment and a fully secure private network. File Roll is protected from all intrusions at the highest level.</pre>', 88, 1, 'circle', '#bc29ac', 'rotate', 1, '2019-05-14 11:15:25', '2019-07-14 14:06:37'),
(3, 'سرعة الاداء', 'fast performance', '<h1>إذا كنت تصنع نفس الفاتورة بنفس المنتجات للعديد من العملاء يمكن أن تستخدم القوالب المعبأة مسبقاً التي تقوم بتحديدها سلفاً لتقوم بإنشاء الفاتورة وإرسالها في ثوان.</h1>', '<h2 data-fulltext=\"\" data-placeholder=\"Translation\" dir=\"ltr\" id=\"tw-target-text\"><strong>If you make the same invoice with the same products for many customers, you can use the prepackaged templates you specify in advance to create and send the invoice in seconds.</strong></h2>', 33, 1, 'circle', 'hsv(118, 29%, 92%)', 'blink', 1, '2019-05-15 09:58:53', '2019-05-20 11:40:43'),
(4, 'سهولة اضافة فريق العمل', 'esay to add more users', '<p>اذا كنت تفكر فى فريق عملك ويشغل بالك أمر إدارته وقيادته ؛ فتأكد أن المفتاح الأساسي يكمن في أن يكون لديك مجموعة من الأشخاص المناسبين، الذين يؤمنون بالفكرة، شغوفون بالعمل ولديهم الالتزام الكامل والقدرة على الانسجام فيما بينهم والتماسك، ومن ثمة ستكون كل المخاوف الأخرى أمرًا ثانويا</p>', '<pre data-fulltext=\"\" data-placeholder=\"Translation\" dir=\"ltr\" id=\"tw-target-text\">\r\nIf you think about your team and take care of its management and leadership, make sure that the key is to have a group of right people who believe in the idea, are passionate about work, have full commitment and harmony, and all other fears will be secondary</pre>', 89, 1, 'normal', 'hsv(0, 0, 0)', 'normal', 1, '2019-05-15 10:00:19', '2019-07-14 14:07:49'),
(5, 'sefsefsef', 'efsfsf', NULL, NULL, NULL, 0, 'circle', '#000000', 'rotate', 4, '2019-07-10 16:04:25', '2019-07-17 08:52:48');
