INSERT INTO `measure_type` (`id`, `name`, `name_en`, `description`, `active`, `sys_user_id`, `activity_id`, `created_at`, `updated_at`) VALUES
(2, 'محيط الخصر', 'waistline', 'استخدم متر قياس بلاستيكي يوضع على محيط الخصر تحت الملابس ولا تقيسي فوقها.\r\n', 1, 1564, 9, '2019-01-08 13:14:34', '2019-03-14 13:12:19'),
(3, 'الظول', 'Length', 'القياس من عند الكتف حتى القدم', 0, 1564, 9, '2019-01-10 09:15:06', '2019-01-22 13:54:28'),
(5, 'الكتف', 'shoulders', 'ضع طرف شريط القياس مستويًا مقابل ظهرك عند نقطة الكتف الأولى، ثم يمرر الشريط فوق منحنى كتفيك بعرض ظهرك', 1, 1564, 9, '2019-01-22 13:53:57', '2019-01-22 13:53:57'),
(6, 'دوران الوسط', 'length of center', 'يتم وضع المتر في أعلي عظام الخصر مباشرة و يلف علي الجسم في وضع موازي للأرض و يشد علي الجسم بشكل خفيف\r\nويتم أخذ القياس و عضلات البطن مسترخية', 1, 1564, 9, '2019-02-18 14:43:33', '2019-02-18 14:43:33'),
(14, 'الارداف', 'width', 'مع المحافظة على القدمين ملتصقتين، قم بالقياس حول القسم الأضيق من الردف مع المحافظة على الشريط في وضع أفقي', 1, 1923, 9, '2019-07-03 10:29:11', '2019-07-03 11:21:10'),
(15, 'الخصر', 'aaaa', 'تحديد موقع الجزء العلوي من عظم الورك الذي يكون في جانب الخصر وليس في الجزء الأمامي من الجسم، حيث يمكن استخدم المنطقة الواقعة بين الإبهام والسبابة للشعور بعظم الورك على جانب الخصر.\r\nوضع حافة شريط القياس على الجزء العلوي من عظم الورك ولفّه حول الخصر، كما يج', 1, 1923, 9, '2019-07-03 11:22:05', '2019-07-03 11:22:05'),
(16, 'الصدر', 'ggfd', 'لفي شريط القياس حول صدرك. اضبطي مكانه بحيث يصبح الشريط أفقيًا وموازي للأرض ويمر تحت إبطيك تمامًا. لفيه حول ظهرك بحيث يلتقي الطرفان في الأمام حول أعرض جزء من صدرك.', 1, 1923, 9, '2019-07-03 11:22:59', '2019-07-03 11:22:59'),
(17, 'اسفل الردف', 'سبس', 'قم بالقياس من أسفل الردف إلى غاية القسم الأسفل من القدم', 1, 1923, 9, '2019-07-03 11:26:23', '2019-07-03 11:26:23'),
(18, 'قياس القدم', 'foot', '<p>قياس القدم من الاصبع الي الكعب</p>', 1, 1, 9, '2019-07-04 11:25:41', '2019-07-04 11:26:30'),
(19, 'sdgsdgsd', 'sdfgsdgsdg', '<p>dsgsdgsdgsdgs</p>', 1, 4, 9, '2019-07-10 16:09:59', '2019-07-10 16:09:59');
