INSERT INTO `programs` (`id`, `name`, `name_en`, `description`, `description_en`, `image_id`, `active`, `sys_user_id`, `created_at`, `updated_at`) VALUES
(10035, 'ادارة الاعمال', 'Business Administration', '<p dir=\"RTL\"><b>لدينا الحل المتكامل لإدارة الأعمال بالسوق العربي الذي يفتقر لمثل هذه الخدمات</b><b>.</b></p>\r\n\r\n<p dir=\"RTL\"><b>مهما كانت طبيعة عملك ستجد أن فايل رول&nbsp;قابل للتخصيص بالكامل ليناسب طبيعة عملك أو شركتك فبداية من خدمة الفواتير البسيطة إلى الأعمال الحسابية المعقدة&nbsp;</b></p>', 'We have an integrated business management solution in the Arab market that lacks such services.\r\nWhatever the nature of your business you will find that File Role is fully customizable to suit the nature of your business or your company, from simple billing service to complex accounting, stores, teams, management and follow-up customers', 43, 1, 1, '2019-05-23 13:04:56', '2019-05-23 13:10:09'),
(10036, 'ادارة صالونات التجميل', 'Beauty Center Program', '<p>الحل الامثل لمراقبة اداء مشروعك عن بعد من اى مكان حول العالم &nbsp;وضبط حساباتك المالية و مراقبتها وتحليل اداء مشروعك<br />\r\nويساعدك على تجنب سوء التنظيم وربكة الزحام خاصة فى الاعياد والمناسبات.<br />\r\n&nbsp;</p>', '<pre data-placeholder=\"Translation\" dir=\"ltr\" id=\"tw-target-text\">\r\nThe best solution to monitor the performance of your project remotely from anywhere around the world and control your financial accounts and monitor and analyze the performance of your project\r\nAnd helps you to avoid mis-organization and confusion of crowds especially in the holidays and events.</pre>', 69, 1, 1, '2019-06-13 12:10:43', '2019-06-13 12:10:43'),
(10039, 'gfhfgh', 'fgh', 'fgh', 'fghfhgh', NULL, 0, 4, '2019-07-17 08:23:07', '2019-07-24 11:08:46');
INSERT INTO `program_advantages` (`id`, `prog_adv`, `prog_adv_en`, `description`, `description_en`, `prog_id`, `image_id`, `sys_user_id`, `active`, `created_at`, `updated_at`) VALUES
(1, 'test', 'test', '<p>test    t</p>', '<p>test</p>', 1, 14, 2, 0, '2019-05-22 06:12:16', '2019-05-22 06:33:08'),
(3, 'مزايا استخدام صالونات التجميل', 'Advantages of using Beauty Center Program', '<p align=\"right\"><span dir=\"RTL\">سهولة اضافة مستخدم و اعطاء صلاحيات لكل مستخدم حسب وظيفته.</span></p>\r\n\r\n<p align=\"right\"><span dir=\"RTL\">سهولة اضافة عضوية لعميل مع طباعة كارت العضوية وارسال ايميل ترحيب بالانضمام</span></p>\r\n\r\n<p dir=\"RTL\">امكانية تحديد قائمة اسعار و تحديثها كل فترة</p>\r\n\r\n<p align=\"right\"><span dir=\"RTL\">امكانية تحديد انواع مختلفة من العروض و تحديثها </span></p>\r\n\r\n<p align=\"right\"><span dir=\"RTL\">&nbsp;عدد غير محدود من العملاء، الموردين، المستخدمين و المنتجات/الخدمات؛</span></p>\r\n\r\n<p align=\"right\"><span dir=\"RTL\">&nbsp;اتاحة استخدام كل صفحات التطبيق باللغتين العربية</span><span dir=\"RTL\">/الانجليزية طبقا لرغبة المستخدم</span></p>\r\n\r\n<p align=\"right\"><span dir=\"RTL\">طباعة عدد من التقارير الاحصائية برسوم بيانية</span></p>\r\n\r\n<p align=\"right\"><span dir=\"RTL\">طباعة عدد من التقارير وتصديرها الى اكسل</span></p>\r\n\r\n<p>&nbsp;</p>', '<pre data-placeholder=\"Translation\" dir=\"ltr\" id=\"tw-target-text\">\r\nThe ease of adding a user and assigning permissions to each user according to his job.\r\nEasy to add a membership to a customer with printing membership card and send a welcome email to join\r\nThe possibility of specifying a list of prices and updating each period\r\nThe possibility of identifying and updating different types of offers\r\n&nbsp;Unlimited number of customers, suppliers, users and products / services;\r\n&nbsp;All application pages are available in Arabic / English according to the user&#39;s wishes\r\nPrint a number of reports and export them to Excel\r\nPrint a number of specialist reports with graphs</pre>', 10036, 70, 1, 1, '2019-06-13 12:16:03', '2019-06-13 12:16:03');
