(1, 'فايل رول', 'FileRole', '<h1>اول بوابة متكاملة وأمنة لإدارة عملك أو شركتك أونلاين. خدمات فايل رول السحابية تعمل على مدار الساعة بضمان تواجد على الشبكة بنسبة 99.9% حيث تتواجد خوادمنا الأمنة في عدة دول وتعمل بالتوازي&nbsp;لتصل إلى بيانات شركتك الأمنة في أسرع وقت ومن أي مكان أو جهاز.</h1>\r\n\r\n<h1>&nbsp;</h1>', '<pre data-fulltext=\"\" data-placeholder=\"Translation\" dir=\"ltr\" id=\"tw-target-text\">\r\n<big>The first integrated and secure portal to manage your business or your company online. Cloud Mail Services is a 24-hour, 99.9% secure network presence where our secure servers are located in several countries and work in parallel to reach your secure company data as quickly as possible from any location or device.</big></pre>', '<p>كل خواص فايل رول تم تصميمها خصيصاً لتسهل عليك عمليات إدارة عملك ولتوفر عليك الوقت و المجهود وبشكل بسيط و سهل بحيث يمكن لأي مستخدم دون خبرة مسبقة بإدارة الأعمال و المحاسبة أن يستخدمه لإدارة عملة بنفس فاعلية المحترف.</p>\r\n\r\n<p>فايل رول تدعم الأنظمة والعملات وإعدادات الضرائب الخاصة بالدول العربية والأجنبية إلى حد سواء.</p>\r\n\r\n<p>&nbsp;</p>', '<p>All of the features of FileRail are designed to make your business processes easier and easier and easier for anyone without prior business and accounting experience to manage as effectively as a professional.</p>\r\n\r\n<p>FileRoll supports systems, currencies and tax settings for both Arab and foreign countries.</p>', 'support@filerolesys.com', 'crm@filerolesys.com', 'www.facebook.com/SwanHouseBeauty', 'twitter.com/Odoo', NULL, 'الاهلى', NULL, NULL, NULL, 0, 50, 4, NULL, '2019-07-24 11:25:45');
