(3, 'من نحن', 'About us', NULL, NULL, 'about-us', '<p>About us<br></p>', '<p>About us<br></p>', '13', 1, '2019-05-19 07:45:10', '2019-05-21 12:20:41'),
(8, 'سياسة الخصوصية', 'Privacy Policy', 'سياسة الخصوصية', 'Privacy Police', 'privacy-and-policy', '<p style=\"text-align: right;\">&nbsp;</p>\r\n\r\n<h3 style=\"text-align: right;\"><span style=\"color: #3366ff;\">سياسة الخصوصية تحكم &nbsp;ما يمكننا وما لا يمكننا فعله مع المعلومات التي تقدمها</span></h3>\r\n\r\n<ol style=\"text-align: right;\">\r\n	<li><strong>من نحن</strong></li>\r\n</ol>\r\n\r\n<p style=\"text-align: right;\">تقدم filerole لك تطبيق المحاسبة وإدارة المخزون. تقع filerole في الولايات المتحدة الأمريكية وتقع في ولاية ديلاوير على 2711 Centerville Road، Suite 400 في مدينة ويلمنجتون ، مقاطعة نيو كاسل ، الرمز البريدي 19808.filerole تحمي خصوصيتك</p>\r\n\r\n<p style=\"text-align: right;\">تلتزم filerole بحماية خصوصيتك وفقًا لأعلى معايير حماية المستهلك.</p>\r\n\r\n<p style=\"text-align: right;\">تم تصميم سياسة الخصوصية الخاصة بنا مع الأخذ في الاعتبار ، وهي جزء لا يتجزأ من فهمك الشامل لممارسات جمع واستخدام المعلومات الخاصة بنا ، وكذلك الثقة التامة بأنك في نهاية المطاف ، يمكنك التحكم في معلوماتك الشخصية المقدمة إلى filerole</p>\r\n\r\n<ol start=\"2\" style=\"text-align: right;\">\r\n	<li><strong>ما المعلومات التي يتم جمعها وكيف نستخدمها؟</strong></li>\r\n</ol>\r\n\r\n<p style=\"text-align: right;\">لن تجمع filerole أو تراقب أي معلومات شخصية عنك دون موافقتك. المعلومات الشخصية الوحيدة التي نجمعها هي ما تخبرنا به عن نفسك ومعلومات حول كيفية استخدامك لموقعنا.</p>\r\n\r\n<ol start=\"3\" style=\"text-align: right;\">\r\n	<li><strong>مع من نشارك معلوماتك؟</strong></li>\r\n</ol>\r\n\r\n<p style=\"text-align: right;\">ا. filerole هو صاحب المعلومات التي تم جمعها على هذا الموقع. نحن لا نبيع أو نؤجر معلومات شخصية فردية لأطراف ثالثة وليس لدينا أي نية للقيام بذلك في المستقبل.</p>\r\n\r\n<p style=\"text-align: right;\">ب. يجوز لنا الكشف عن معلوماتك الشخصية في بعض الأحيان إلى أطراف ثالثة تعمل معنا. قد تقع بعض هذه الأطراف الخارجية خارج بلدك الأم أو خارج الولايات المتحدة الأمريكية. سيتم حماية المعلومات بطريقة تتوافق مع سياسة الخصوصية هذه.</p>', '<h3><span style=\"color: #3366ff;\">This Privacy Policy governs what we can and cannot do with the</span><br />\r\n<span style=\"color: #3366ff;\">information that you provide</span></h3>\r\n\r\n<ol>\r\n	<li><strong>Who we are</strong>\r\n\r\n	<ul>\r\n		<li><strong>Filerole</strong> offers you an accounting and inventory management application filerole is based in USA and is located at in the state of Delaware is 2711 Centerville Road, Suite 400 inthe city of Wilmington, county of New Castle, zip code 19808.filerole protects your privacy</li>\r\n		<li><strong>Filerole</strong> is committed to protecting your privacy in accordance with the highest consumer protection standards.</li>\r\n		<li>Our privacy policy is designed with you in mind, and it is integral that you have a comprehensive understanding of our information collection and usage practices, as well as full confidence that ultimately, you have control of your personal information provided to filerole . In summary, while you should read each provision in this Privacy Policy, you note that by using the filerole web site:\r\n		<ul>\r\n			<li>You agree that if you disclose your personal information to us, we may create a database record about you;</li>\r\n			<li>If you register on our website, download any materials or conduct any other transaction, you agree for us to collect information necessary to provide you with the service you have requested, and you agree that this information may be disclosed to service partners (who may be third parties) for those purposes;</li>\r\n			<li>You agree for us to use cookies on your browser (unless you remove them);</li>\r\n			<li>You agree that we can contact you with information about products and services which may be of interest to you (unless you have stated you do not wish to receive these communications); and</li>\r\n			<li>Your continued use of the filerole web site indicates your agreement with any future changes in the filerole Privacy Policy</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n\r\n<ol start=\"2\">\r\n	<li><strong>What information is collected and how do we use it?</strong></li>\r\n</ol>\r\n\r\n<p>filerole will not collect or monitor any personal information about you without your consent. The only personal information we collect is what you tell us about yourself and information about how you use our web site. filerole collects information from you at several different points on the site:</p>\r\n\r\n<ol>\r\n	<li><u>New Account Registration</u></li>\r\n</ol>\r\n\r\n<p><strong>What information is collected?</strong></p>\r\n\r\n<ol start=\"6\">\r\n	<li>When you register for an account with filerole , you will be asked to create a login name and password, as well as to provide your contact information, such as your name, title, email address, language preference and country of location.</li>\r\n	<li>You may also be asked to give billing information such as credit card billing information, your credit card type, number, expiry date and billing address.</li>\r\n	<li>You are also given the option to sign up for periodical updates and/or newsletters from filerole informing you of the latest news and deals.</li>\r\n</ol>\r\n\r\n<p><strong>Why do we collect it?</strong></p>\r\n\r\n<p>We collect the above information for the following purposes:</p>\r\n\r\n<ol start=\"9\">\r\n	<li>To identify you when you use our site in order to enjoy a customized and personalised experience.</li>\r\n	<li>To present you with a default screen layout based on the country of location you select.</li>\r\n	<li>As a security measure, to send you an email confirming your account registration.</li>\r\n	<li>To allow us to process and complete your purchases.</li>\r\n	<li>To allow you to enjoy convenience whenever you make purchases as you will not have to type the billing information repeatedly.</li>\r\n	<li>To send you email confirmations for actions on Daftra.</li>\r\n	<li>To further confirm your identity.</li>\r\n	<li>To prevent credit card fraud.</li>\r\n	<li>For our customer service agents to contact you when necessary.</li>\r\n	<li>To send you our optional periodical updates and/or newsletters, if you have signed up for them.</li>\r\n	<li>To send you information about products and services which may be of interest to you.</li>\r\n	<li><u>Online Surveys</u></li>\r\n</ol>\r\n\r\n<p><strong>What information is collected?</strong></p>\r\n\r\n<p>From time to time, filerole may conduct market research surveys either by itself or by employing the services of a third party to do so on our behalf. You may choose to participate in our surveys, and your answers to our survey, as well as your contact information may be kept on record, and will be protected in a manner that is consistent with this privacy policy. Please note that the information you provide through our surveys will be used on an aggregated basis unless we inform you otherwise beforehand.</p>\r\n\r\n<p><strong>Why do we collect it?</strong></p>\r\n\r\n<p><strong>Filerole</strong> conducts market research surveys in order to learn from you how improvements can be made to our site To send you information about products and services which may be of interest to you.</p>\r\n\r\n<ol>\r\n	<li><u>Customer Contact</u></li>\r\n</ol>\r\n\r\n<p><strong>What information is collected?</strong></p>\r\n\r\n<p>You may choose to provide feedback to <strong>Filerole</strong>, for example through email or letters. The comments in your feedback, as well as your contact information like your email, if provided to <strong>Filerole</strong> , may be kept on record.</p>\r\n\r\n<p><strong>Why do we collect it?</strong></p>\r\n\r\n<ol start=\"20\">\r\n	<li>The feedback that you choose to provide is valuable in helping filerole make improvements to our service to you. In order to follow-up on the feedback you have chosen to provide, filerole may correspond with you using the contact information that you have provided.</li>\r\n	<li>To send you information about products and services which may be of interest to you.</li>\r\n	<li><u>Cookies</u></li>\r\n</ol>\r\n\r\n<p><strong>What information is collected?</strong></p>\r\n\r\n<p>When you visit filerole as a Guest or account holder, a cookie is stored onto your computer. A cookie is a small, encrypted text file containing some information about your preferences and allows your usage to be tracked. The use of cookies is now an industry standard, and you will find them used on most major web sites. However, you can always choose to disable cookies from being stored on your computer by changing your browser settings. Disabling cookies, however, may result in a limited experience of our functionality and services and in some cases may mean that we are unable to provide you with the services, or parts of the services, that you have requested. Some of our business partners whose content is incorporated into or linked to from our site may also use cookies. However, we have no access to or control over these cookies.</p>\r\n\r\n<p><strong>Why do we collect it?</strong></p>\r\n\r\n<p>Cookies, when stored on your computer, facilitate the following:</p>\r\n\r\n<ol start=\"22\">\r\n	<li>Cookies allow us to save passwords and preferences for you so that you will not have to re-enter them the next time you visit. This means you will be able to enjoy conveniences such as login without having to type your login name every time you visit filerole .</li>\r\n	<li><strong>Filerole</strong> will be able to make improvements to our site based on the aggregated usage statistics collected from cookies. These aggregated usage statistics are anonymous to third parties, and may also be used by filerole&#39;s&nbsp; third party advertising companies in monitoring the effectiveness of advertisements.</li>\r\n	<li><u>Other Computer Information</u></li>\r\n</ol>\r\n\r\n<p><strong>What information is collected?</strong></p>\r\n\r\n<p>Session information such as IP (Internet Protocol) addresses, browser types, operating systems are also used for filerole&rsquo;s system administration.</p>\r\n\r\n<p><strong>Why do we collect it?</strong></p>\r\n\r\n<p>Session information will allow us to enhance your experience on filerole by allowing us to troubleshoot technical issues as well as to improve our site usability.</p>\r\n\r\n<ol start=\"3\">\r\n	<li><strong>Who do we share your information with?</strong></li>\r\n	<li>filerole is the owner of the information collected on this site. We do not sell or rent individual personal information to third parties and have no intention to do so in the future.</li>\r\n	<li>We may disclose your personal information on occasion to third parties who work with us. Some of these third parties may be located outside your home country, or outside of USA. The information will be protected in a manner that is consistent with this Privacy Policy. Disclosure will be made in the following scenarios for the following purposes:</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li><strong>When you make purchases on </strong>filerole</li>\r\n</ol>\r\n\r\n<p>To successfully complete your purchases or otherwise implement our terms of service, your personal information is provided as needed to filerole&rsquo;s third party product and service providers or other third parties authorised by filerole, if any.</p>\r\n\r\n<ol>\r\n	<li><strong>When third parties perform services on behalf of </strong>filerole</li>\r\n</ol>\r\n\r\n<p>In our efforts to continually improve our site, filerole may employ the services of third party companies to perform projects such as market research surveys on our behalf.</p>\r\n\r\n<ol>\r\n	<li>When required by law to disclose the information</li>\r\n	<li>With your prior express consent</li>\r\n	<li>To protect the rights and property of filerole</li>\r\n	<li>To enable third parties to send you information about products and services which may be of interest to you</li>\r\n	<li>Links may be present on the filerole site which result in you leaving the filerole site and being taken to other third party web sites. You should note that any information that you provide to these third party web sites are not subject to the filerole privacy policy, and we strongly recommend that you be aware of their privacy and security policies.</li>\r\n	<li><strong>Filerole</strong> may also work with third parties that serve ads to this site. Information that may be disclosed to such third parties will be anonymous.</li>\r\n	<li>You should also note that the processing of information on the <strong>Filerole</strong> site and the transmission of transaction messages relating to purchases, including your account related data, may involve transmissions over various networks (which may not be secure) and to various countries and further processing and storage of data in such countries.</li>\r\n	<li><strong>You have control over your information!</strong></li>\r\n	<li><strong>Opt In and Opt Out Policy</strong></li>\r\n</ol>\r\n\r\n<p>You always have the option to opt in to participate in filerole&rsquo;s product and service offers. For example, you will be given the option to subscribe to filerole&rsquo;s newsletters by checking the box.</p>\r\n\r\n<p>While <strong>Filerole</strong> hopes that you benefit from our product and service offers, at any time, you always have the option to opt out of the products and services that you have subscribed to.</p>\r\n\r\n<p>We offer you the ability to opt out of receiving information of our products and services at the point of collection, or by accessing and changing your account information. Please allow some time for this request to be processed.</p>\r\n\r\n<ol>\r\n	<li><strong>Accessing your information and retention of information</strong></li>\r\n</ol>\r\n\r\n<p>You may at any time access and change your account or personal information or subscribed services. You can easily access your personal information if you login to your account with <strong>Filerole</strong>, or you can follow the links that may be provided within our subscription emails to you to manage your subscription preferences. Although we will take reasonable steps to keep your information accurate, complete and up-to-date, we request that you keep your information as current as possible so that we may continue to improve our service to you.</p>\r\n\r\n<p>We will only withhold your access to such information in extremely limited circumstances where it is permitted by law, such as:</p>\r\n\r\n<ol>\r\n	<li>where it might be dangerous if you were to have it;</li>\r\n	<li>where it might prejudice an investigation currently underway;</li>\r\n	<li>where it relates to court proceedings and may be subject to the discovery process;</li>\r\n	<li>where it may relate to a commercially sensitive decision-making process; or</li>\r\n	<li>where other individuals&rsquo; personal information is contained in the same record.</li>\r\n</ol>\r\n\r\n<p><strong>Filerole</strong> may (but is not obliged to) retain your information for a period of 7 years from the date you last accessed your account.</p>\r\n\r\n<ol>\r\n	<li><strong>Minors</strong></li>\r\n</ol>\r\n\r\n<p>As we cannot distinguish the age of persons who access our site, a blanket privacy policy is applied. filerole does not intent nor does it seek to receive any personal information from minors. Should a parent or guardian have reason to believe that a minor has provided filerole with personal information without their prior consent, please contact us to ensure that the information is removed and unsubscribe them from any promotional contact opportunities.</p>\r\n\r\n<ol>\r\n	<li><strong>Security</strong></li>\r\n</ol>\r\n\r\n<p><strong>Filerole</strong> has implemented technology and security features to safeguard the privacy of your personal information. A secure server protects your personal information. Additionally, with filerole, you can be assured that the information you provide to filerole is transmitted using Secure Socket Layer (SSL) encryption. If you become aware of any security breach, please let us know as soon as possible.</p>\r\n\r\n<p>We have internal procedures in place requiring our employees and data processors to respect the confidentiality of any personal information held by filerole.</p>\r\n\r\n<p><strong>Filerole</strong> will endeavour to take all reasonable steps to keep secure any information which we hold about you. Your information is stored on secure servers that are protected in controlled facilities. Unfortunately, despite the aforementioned technology and security features, no data transmission over the Internet can be guaranteed to be 100% secure, so we cannot give an absolute assurance that the information you provide to us will be secure at all times, and we cannot be responsible for any event arising from unauthorised access to your personal information. filerole will not be held responsiblefor events arising from third parties gaining unauthorized access to your personal information.</p>\r\n\r\n<p>Please note also that <strong>Filerole</strong> may use overseas facilities to process or back up its information. As a result, we may transfer and store your personal information to our overseas facilities. However, this does not change any of our commitments to safeguard your privacy.</p>\r\n\r\n<ol>\r\n	<li><strong>Keep your password safe</strong></li>\r\n</ol>\r\n\r\n<p>You can play your part in safeguarding your personal information by never disclosing your Login password or account information to anybody. Whenever you login as a member on filerole, particularly on somebody else&rsquo;s computer or on public internet terminals, you should always logout at the end of your session. Your assistance will help us protect the privacy of your personal information. filerole cannot be held responsible for lapses in security caused by third party accesses to information as a result of your failure to keep your personal information private. Please notify us immediately if there is any unauthorised use of your account by any other internet user or any other breach of security.</p>\r\n\r\n<ol>\r\n	<li><strong>Changes to the Filerole&nbsp;Privacy Policy</strong></li>\r\n</ol>\r\n\r\n<p><strong>Filerole</strong> may amend this Policy from time to time. If we make any substantial changes in any way we use your personal information, we will notify you by posting a prominent announcement on our web pages or by way of an e-mail and you will have a choice as to whether or not we may use the information in this different manner.</p>\r\n\r\n<p><strong>Thank you for taking the time to understand the Filerole</strong><strong> Privacy Policy.</strong></p>\r\n\r\n<p>&nbsp;</p>', NULL, 1, NULL, '2019-06-18 14:22:44'),
