(5, 'انشىء فاتورتك الاولى', 'Create your first bill', 'يمكنك استخدام هذا الرابط للتحكم فى حسابك', 'You could use this URL to control your account', 'Free Plan', '<p>نظام فابل رول اقوى واكثر بساطة ويساعدك فى انشاء وحفظ فواتيرك يسهولة وسرعة فى اقل من دقيقة. لقد صممنا فايل رول ليساعدك على ادارة شركتك بشكل افضل. كما اهتممنا بابقاء بيانات شركتك فى امان. وزودنا نظام فايل رول بالعديد من الاضافات والاوات التى تساعدك فى ادارة كافة جوانب شركتك بسهولة والحفاظ على كافة بيانات شركتك امنه من الضياع والسرقة.</p>', '<p>A more powerful, simple and easy-to-use system that helps you create and save your bills easily and quickly in less than a minute. We designed FileRole to help you manage your business better. We have also taken care to keep your company data safe. We have provided Vail Roll system with many additions and benefits that help you manage all aspects of your company easily and keep all your company data safe from loss and theft.</p>', NULL, 1, NULL, '2019-07-03 07:52:08'),
(6, 'استخدام الترقية', 'Using Upgrade', 'يمكنك استخدام هذا الرابط للتحكم فى حسابك', 'Using Upgrade', 'paid-plan', 'نظام فابل رول اقوى واكثر بساطة ويساعدك فى انشاء وحفظ فواتيرك يسهولة وسرعة فى اقل من دقيقة. لقد صممنا فايل رول ليساعدك على ادارة شركتك بشكل افضل. كما اهتممنا بابقاء بيانات شركتك فى امان. وزودنا نظام فايل رول بالعديد من الاضافات والاوات التى تساعدك فى ادارة كافة جوانب شركتك بسهولة والحفاظ على كافة بيانات شركتك امنه من الضياع والسرقة.   الان يمكنك الاستمتاع بوظائف افضل وامكانيات اعلى للنظام حسب الخطة المختارة.', 'The File Roll System is more powerful and simpler and helps you to create and save your bills easily and quickly in less than a minute. We designed File Roll to help you manage your business better. We have also taken care to keep your company data safe. We have provided Vail Roll system with many additions and benefits that help you manage all aspects of your company easily and keep all your company data safe from loss and theft. Now you can enjoy the best functions and higher capabilities of the system according to the chosen plan.', '68', 1, '2019-06-13 12:01:50', '2019-07-23 09:08:08'),
(7, 'الشروط والاحكام', 'Terms And Conditions', 'الشروط والاحكام', 'Terms And Conditions', 'terms-and-conditions', '<p dir=\"RTL\"><span courier=\"\" new=\"\">ا</span><span courier=\"\" new=\"\">لشروط والأحكام التالية تحكم علاقتنا مع عملائنا</span></p>\r\n\r\n<p dir=\"RTL\"><span courier=\"\" new=\"\">1. هذه الشروط والأحكام ملزمة قانونًا</span></p>\r\n\r\n<p dir=\"RTL\"><span dir=\"LTR\" inherit=\"\">Izam</span><span courier=\"\" new=\"\">، </span><span dir=\"LTR\" inherit=\"\">Inc</span><span courier=\"\" new=\"\">. هي مالك ومشغل خدمة </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> (&quot;الخدمة&quot;). إن استخدامك للخدمة مشروط صراحة بقبولك لشروط وأحكام </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> هذه (&quot;الشروط والأحكام&quot;). باستخدام الخدمة ، فإنك تشير إلى أنك توافق وتقبل دون قيد أو شرط أن تكون ملزمًا قانونًا بهذه الشروط والأحكام. لا تسري على </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> أو أي شروط أو شروط أخرى من أي نوع في أي مستند أو كتابة أو أي اتصال آخر من أي نوع تقوم به إلى </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> أو موظفيها أو ممثليها أو وكلائها فيما يتعلق بالخدمة.</span></p>\r\n\r\n<p dir=\"RTL\"><span courier=\"\" new=\"\">2. التغييرات في هذه الاتفاقية أو الخدمات.</span></p>\r\n\r\n<p dir=\"RTL\"><span courier=\"\" new=\"\">تحتفظ </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> بالحق في تغيير هذه الشروط والأحكام في أي وقت. ستكون هذه التغييرات فعالة وملزمة قانونًا لك عند نشرها على موقع الويب الخاص بنا للخدمة أو عندما نبذل جهودًا معقولة لإعلامك بوسائل أخرى. يرجى مراجعة هذه الشروط والأحكام بشكل دوري للتغييرات. إن استمرار استخدامك لهذه الخدمة بعد نشر الشروط والأحكام المعدلة على هذا الموقع أو توجيه انتباهكم إلينا بطريقة أخرى يعني موافقتك وقبول الالتزام القانوني بهذه التغييرات.</span></p>\r\n\r\n<p dir=\"RTL\"><span courier=\"\" new=\"\">3. منح التراخيص للاستخدام</span></p>\r\n\r\n<p dir=\"RTL\"><span courier=\"\" new=\"\">أ. تمنح </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> بموجب هذا حقًا محدودًا وغير حصري وغير قابل للتحويل لاستخدام الخدمة بشرط موافقتك على ما يلي: -</span></p>\r\n\r\n<p dir=\"RTL\"><span courier=\"\" new=\"\">أنا. يجوز لشركة </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> ، وفقًا لتقديرها المطلق والمطلق ، دون إخطار مسبق لك ودون مسؤولية ، رفض أو منع أو إيقاف أو تعليق حسابك (حساباتك) و / أو استخدامك للخدمة إذا كانت </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> ، وفقًا لتقديرها الخاص ، رأوا أن استخدامك لا يتوافق مع مواصفات أو إرشادات </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> ، أو التي قد تعتبر </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> غير مناسبة أو غير قانونية أو ضارة بمصالحها. إذا مارست </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> سلطتها التقديرية المطلقة بموجب هذه الفقرة 3.1 (أ) ، فلن تتحمل أية مسؤولية عن استرداد أي جزء من اشتراكاتك المدفوعة مسبقًا ، إن أمكن. دون تقييد أو التنازل عن أي حق ضدك قد يكون لدى </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> بموجب القانون أو هذه الشروط والأحكام فيما يتعلق بأي استخدام غير مناسب أو غير قانوني أو ضار ، تحتفظ </span><span dir=\"LTR\" inherit=\"\">FileRole</span><span courier=\"\" new=\"\"> بالحق في خصم أي تكاليف أو أضرار أو نفقات قد تكون تكبدتها فيما يتعلق لهذا الاستخدام غير اللائق أو غير القانوني أو الضار من اشتراكاتك المدفوعة مسبقًا غير المستخدمة ، إن وجدت ، أو للمطالبة بنفسك بأي وسيلة أخرى.</span></p>', '<h2>The following Terms and Conditions govern our relationship with our clients</h2>\r\n\r\n<h3>1. These Terms and Conditions Are Legally Binding</h3>\r\n\r\n<ul>\r\n	<li>Izam, Inc.is the owner and operator of the Daftra service (&ldquo; the Service&rdquo;). Your use of the Service is expressly conditioned on your acceptance of 